// Routes.js
import { AUTH } from '../Views/AUTH/AUTH';
import { Blogs } from '../Views/Blogs/Blogs';
import { CreateBlog } from '../Views/Blogs/CreateBlog';
import { BlogDetail } from '../Views/Blogs/BlogDetail';

const MyURLs = [
    {
        path: "/",
        view: AUTH,
        title: "AUTH"
    },
    {
        path: "/blogs",
        view: Blogs,
        title: "Blogs"
    },
    {
        path: "/create-blog",
        view: CreateBlog,
        title: "Create Blog"
    },
    {
        path: "/blog/:id",
        view: BlogDetail,
        title: "Blog Detail"
    }
];

export default MyURLs;
